import React from 'react';

const Home = () => {
    return (
        <div className="landing">
            <h1>Hi, I'm Jiteen Mohanty, a passionate Software Developer.</h1>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>
            <p>Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.</p>
            <div className="explore-button-container"><p>Explore my work and get to know me better!<a className="explore-button"href="#about">About</a><a className="explore-button" href="#projects">Projects</a></p></div>
            <div className="social-links">
                <a href="#"><i className="fab fa-linkedin"></i> LinkedIn</a>
                <a href="#"><i className="fab fa-github"></i> GitHub</a>
                <a href="#"><i className="fas fa-envelope"></i> Email</a>
                <a href="#"><i className="fas fa-file-download"></i> Download CV</a>
            </div>
        </div>
    );
};

export default Home;
